    <script>
        $(".nav-link-custom").on("click", function (e) {
            var target = this.hash,
                $target = $(target);
            $("html, body")
                .stop()
                .animate(
                    {
                        scrollTop: $target.offset().top - 50,
                    },
                    700,
                    function () {
                        window.location.hash = target;
                    }
                );
            if (window.matchMedia("(max-width: 1199px)").matches) {
                $(".navbar .navbar-collapse .nav-item").removeClass("active");
                $(this).closest(".nav-item").addClass("active");
                $("html").removeClass("sidebar-open");
                $(".navbar .navbar-collapse").removeClass("show");
            }
        });
        $(document).ready(function () {
            $(".navbar .navbar-toggler").on("click", function () {
                $("html").addClass("sidebar-open");
                $(".navbar .navbar-collapse").addClass("show");
            });
            if (window.matchMedia("(max-width: 1199px)").matches) {
                const backdrop = '<div class="backdrop"></div>';
                $(".navbar").append(backdrop);
            }
            $(document).on("click", function (e) {
                if ($(e.target).hasClass("close") || $(e.target).hasClass("backdrop")) {
                    $("html").removeClass("sidebar-open");
                    $(".navbar .navbar-collapse").removeClass("show");
                }
            });
        });
        
        $(window).scroll(function () {
            if (window.matchMedia("(min-width: 1200px)").matches) {
                var scrollDistance = $(window).scrollTop();
                // Assign active class to nav links while scolling
                $(".page-section").each(function (i) {
                    if ($(this).position().top - 400 <= scrollDistance) {
                        $(".navbar .nav-item.active").removeClass("active");
                        $(".navbar .nav-item").eq(i).addClass("active");
                    }
                });
            }
        });
        
        $(window).scroll(function () {
            if (window.matchMedia("(min-width: 768px)").matches) {
                if ($(window).scrollTop() > 300) {
                    $(".float_call").addClass("show");
                } else {
                    $(".float_call").removeClass("show");
                }
            }
        });
    </script>
